const stepResults = testRunner.getTestRun().stepResults
const allStepResults = testRunner.getTestRun().stepResults
const thisTestStepResults = allStepResults.filter(stepResult => testRunner.currentTest.steps.find(step => step === stepResult.step))
data.oneAdShown = 0
data.i = 1
for(data.i = 1; data.i <= thisTestStepResults.length; data.i++){   //36
   log((data.i-1)+' steps before prev result: '+thisTestStepResults[currentStepIndex-data.i].success)
   if(stepResults[currentStepIndex-data.i].success){
     log('At least one add shown: '+data.i+'th from the end')
     data.oneAdShown = 1
     break
   }
}
if(data.oneAdShown == 0){
  throw "damn- no ad shown at all!"
}
